void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (2.* fragCoord - iResolution.xy) / iResolution.y;

    vec3 col = vec3(0.);

    float d = length(uv);
    d = 15. / d;

    col += abs(sin(4.*d + iTime));

    // Output to screen
    fragColor = vec4(col,1.0);
}
